        "source": "instagram",
        "attrs": [
            "src:graph"
        ],
        "status": "published",
        "message": "It’s been a rough go lately. I don’t know how all the other tradesmen stay on top of posting and work at the same time. 😅 Between the migraines I deal with, being sick recently, and summer had already started here, it’s been difficult. I post more in my stories if anything. I’m too lazy to turn those into reels. If I’m being honest, I don’t care about the likes or views. I care more about entertaining and educating people at the same time. Sharing what I know while trying not to bore anyone. It’s tough to do after long days at work. One day I’ll get around to it. 😄\n\nAnyways, how sick is the milwaukeetool packout stuff?! I’m not addicted, I promise. This stereo is a lifesaver and the new hydro flask has been nice. This is not an endorsement. 😂 I use this stereo on any job I can. I hook it to my packout crate and rope it up with anything else I load the crate with. It makes the hard jobs a little bit easier. I can also attach my water bottle and not have to worry about knocking it over or having it roll away. 😅 Now if I could find a way to get milwaukeetool to throw some swag this way, that’d be great. \n\n#hvacr #hvac #airconditioning #refrigeration #lifeinthetrades #milwaukee #packout #milwaukeepackout #commercialhvac #bluecollar #resilient #onedayatatime #sponsormeplease",
