        "status": "published",
        "message": "Here’s a discreet hose reel install we fit off for a good client of ours. \nAfter a recent reno our client wasn’t happy with mains water pressure he was left with at the rear of the property. We were asked to step in and investigated why and found a higher pressurised line coming directly off the mains water supply that gives the desired water pressure to water the back yard. From this line we tapped in and setup a copper run in the back of this garden bed to a convenient tap and reel location. \nIf you would like added hose taps or would like us to investigate your potential water pressure issues please give us a call. \n.\n.\n.\n.\n.\n.\n.\n.\n.\n.\n.\n.\n.\n.\n#outnaboutplumbing #plumbing #plumbinglife #hosereel #samios #samiosplumbingsupplies #samiosplumbing #reeceplumbing #reeceplumbingsupplies #milwaukeetool #milwaukeetools #milwaukeetoolsaus #milwaukeepackout",
