        "image": "https://content-cdn.teaser.stackla.com/1451/608888f360399827c52fb234/image",
        "original_url": "https://www.instagram.com/p/COKoYmsAZj6/",
        "message": "Photo by daisygilardini / I’ve landed on Half Moon Island in Antarctica dozens of times during my career documenting the polar regions. Quite often we find Weddell seals resting on the pebble beaches that dot the Island. The seals give birth to their pups in early spring (September/October), but it’s not easy to actually see them. In the last 20 years I’ve seen a few, but hardly ever in approachable situations.\n\nYou can imagine the smile on my face, then, the early November day we stepped on this beach. Just a few meters from crashing waves on a bank of pure white snow, a mother Weddell seal rested with her young pup. I spent the next three hours observing this cute little baby.\nThe pup was shy at first. I let him get used to my presence by just standing there, without moving. After a while he grew more comfortable and started playing with his flippers, biting them, scratching, and making the silliest grimaces. It was one of the most precious afternoons I’ve ever spent in Antarctica. While editing the images, I could not stop giggling.\n\nFollow me daisygilardini for more images and behind-the-scenes stories. #weddellseals #antarctica #simplicity #wildlifephotography #climatechange",
