        "original_url": "https://www.instagram.com/p/CN5C3mbJUTN/",
        "message": "Photos by Michael Yamashita yamashitaphoto / Fallen cherry blossoms signal the end of Japan's sakura season. The Hanami (cherry blossom viewing) season reached its peak in Kyoto on April 2, the earliest full blooming date in 1,200 years. Data-watchers and scientists say it's due to climate change. Japanese traditionalists believe that the race to catch the fleeting burst of white-and-pink petals is one of the reasons that the cherry blossom is so cherished there. The delicate blossoms explode into bloom one day, then quickly drop to the ground in a perfumed snowfall the next. To die like a cherry blossom, which falls at the peak of its beauty, held deep appeal to the samurai, Japan's warrior class. It represented the samurai ideal: a short but beautifully lived life. #hanami #sakura #cherryblossoms #samurai #samurailife",
