        "original_url": "https://www.instagram.com/p/CN5CykFjzrs/",
        "message": "Photo by paulnicklen / When you spend enough time immersed in the world of another species, you start to see them as individuals, with routines and habits just like us. They yawn and stretch when they wake up. They groom, they play, they eat, they explore. They have families and relationships. They look for somewhere comfortable to fall asleep at night. They do what they must to survive in a world that is rapidly changing around them. At the end of any assignment, images that depict everyday life in the wild usually end up being my favorites. I hope that these moments can help us to see enough of ourselves in a polar bear, a leopard seal, or a humpback whale that we will be inspired to fight against climate change on their behalf.\n\nFollow me paulnicklen for more stories that reveal how much we have in common with the animals who share our planet. #bear #polarbear #svalbard #norway #climatechange",
