        "message": "Photo by jason_gulley_science / Cave scientist Dr. Matt Covington pops out of a narrow canyon into a small tunnel beneath Rieperbreen, a cold-based glacier in Svalbard. Dr. Covington and his team were studying how caves form in Svalbard's coldest and slowest-moving glaciers. In cold-based ice, where glaciers are frozen to their beds, rivers can incise canyons through 10s of meters of ice to reach the glacier bottom. Drifting snow and ice deformation close off the upper reaches of the canyons to form caves like this one. #Svalbard #glacier #cave #Arctic #SciComm",
