        "message": "Photo by paoloverzone / Jaouavi, Morocco: Amanda Emke, a student at the University of Detroit Mercy, and Nizar Ibrahim, paleontologist and National Geographic explorer, evaluate  fossils at a new site, as part of their work on a Spinosaurus find. Spinosaurus was one of the largest predatory dinosaurs of all time. It is named after the elongated dorsal spines that supported an enormous “sail” of skin. In contrast to other dinosaurs–which are predominantly terrestrial–a long list of anatomical features are indicative of Spinosaurus being adapted to live in freshwater, like crocodiles and hippopotamuses. Follow paoloverzone for more photos and stories.\n\nCheck out Nat Geo's link in bio for more on this story.",
