        "message": "Photo by CarltonWard / Florida might be best known for its beaches, but it is also a land of forests. In addition to its 175 state parks, many of which are forested, Florida is home to 38 state forests and three national forests. Ocala National Forest protects 155,000 hectares (383,000 acres) in central Florida. The land is an essential hub of the statewide Florida Wildlife Corridor and includes vast longleaf pine and wire grass habitat (pictured). The forest also contains hundreds of freshwater springs, lakes, and ponds as well as some of the most scenic segments of the 1,300-mile (2,092-kilometer) Florida National Scenic Trail.\n\nPathofthePanther is supported by the National Geographic Society, working to inspire the protection of the Florida Wildlife Corridor—the statewide network of public preserves combined with private farms, ranches, and forests that the panther needs to survive. insideNatGeo #FloridaWildlifeCorridor #KeepFLWild",
