        "original_url": "https://www.instagram.com/p/CN3NFQSDd8e/",
        "message": "Photo by Cristina Mittermeier Mitty / Over the years, I’ve shared many hours in the water with giants like these sperm whales, and I've learned to read their subtle cues to avoid disturbing them as I work. Despite their massive size, whales are surprisingly sensitive, and even the smallest changes in their surroundings can affect them. Every aspect of their life cycle is deeply intertwined with the health of our ocean, and they even assist in sequestering carbon from our oversaturated atmosphere, storing it in the dense fat of their bodies, like trees. After they die, they sink quietly into the depths, dragging the carbon they’ve stored with them to rest at the bottom of the ocean. There is simply no end to the incredible services whales provide for our planet, and I’m thrilled to see their populations bounce back after years of whaling. Follow me Mitty to learn more about how you can help protect whales and other marine animals as I work with my team SeaLegacy to restore our ocean.",
