        "message": "Photo by daisygilardini / Weddell seals feed mainly on fish, squid and other invertebrates, such as krill. They are extraordinary divers. They can dive up to depths of 600m and spend more than an hour underwater.\rThey are the southernmost breeding mammal on Earth and can be found from New Zealand's Sub-Antarctic Islands to the Ross Sea in Antarctica.\rI simply love their cat-like faces and the beautiful patterns of their grey coats. \rThey often come on land or lie on ice to rest and digest their food, so it's not that easy to photograph them and capture their expressions, as they're very passive when out of  the water.\rFollow me daisygilardini for more images and behind-the-scenes stories.\r#Antarctica #seal #weddellseal #conservation #climatechange",
