        "image": "https://content-cdn.teaser.stackla.com/1451/607fbb029be806b0f4287440/image",
        "original_url": "https://www.instagram.com/p/CN2V-TxsYCa/",
        "message": "Photo 📷 by stevewinterphoto \n\nI photographed this cheetah family at the andbeyondphinda game reserve in South Africa. Cheetahs are one of my favourite big cats not only because they are the fastest land animal on earth and Africa’s most endangered cat (they can clock a top speed of close to 90 km/hr) but because they purr like house cats! This is just one reason they are under threat, as the cubs are either captured or raised in captivity to be sold as pets to the very wealthy, though only one in six survive the journey to their new prison. Recent sting operations have shown this in East Africa! As with all big cats the number one reason for the decline of wild cheetahs is habitat loss, followed by human wildlife conflict where livestock owners kill predators in revenge killings if the predator kills their livestock. Finally comes the illegal wildlife trade, the pet trade is hitting cheetahs hard as is the trade in their skins and bones. Recent research led by Sarah Durant and colleagues suggests there may be as few as ~7100 cheetahs left in Africa, and that if their populations are to survive, they need good protection inside national parks to offset losses in community areas where they clash with farmers! Follow me stevewinterphotofor more big cats 🐆\n.\n.\n.\n.\n.\n#cheetah #cub #baby #conservation#wildlife #wilderness #beauty#cheetahs",
