        "image": "https://content-cdn.teaser.stackla.com/1451/607fbb03eb97b6b0db9f167a/image",
        "original_url": "https://www.instagram.com/p/CN1LGVqKPit/",
        "message": "Photo by babaktafreshi / Dune after dune, the sand continues all the way to the horizon, reminiscent of the folk stories of Arabian Nights. Above Al Quaa desert of the United Arab Emirates in 2018, this star-filled sky appeared far from the glow of Dubai and Abu Dhabi, where the sky is almost empty of stars. This is a last remaining dark sky refuge in the region. Here you can see an elegant celestial light that most people have never seen due to light pollution.\n\nThe elongated patch of zodiacal light appeared right after dusk. The cone-shaped diffuse band of light does not come from a city, nor from the atmosphere. It comes from dust particles in the solar system plane scattering sunlight near Mars and beyond. It was thought the dust is remnants of asteroids or comets, but a new study by NASA's Juno mission to Jupiter shows Mars dust storms may be the source of these particles!\n\nHave any of you seen the mysterious zodiacal light? Please leave a comment. It’s now a great time of the year to see it in the Northern Hemisphere. Look to the west after dusk (best in March-April) or to the east before dawn (best in September-October). The angle of the solar system plane (known as ecliptic) is very low on the horizon in polar latitudes, which means zodiacal light won’t be easily visible in high latitudes. The condition in the tropics is the opposite. This is where you can see it all year. But remember, you need truly dark skies! This page helps you find one: babaktafreshi.com/darksky.\n\nFollow me babaktafreshi to learn more. #twanight #nightsky #desert #uae #zodiacallight",
        "source_created_at": 1618799425,
        "via": "instagram_business",
        "lang": "en",
        "lang_detection_type": "cld",
