        "message": "Photo by hannahreyesmorales / Moving out of the city to live by the ocean has expanded my understanding of what a neighborhood is. Blocks from my home, a local turtle conservationist runs projectcurma, where members of the community volunteer to patrol for nests. Little olive ridley turtles, our newest neighbors, get ready for their maiden voyage in the same waters we play, surf, and coast through.\n\nThe Philippines is an archipelago in the center of the world’s marine biodiversity. Seeing turtles make their way out to sea made me think about what it means to call these islands home. As they paddled out, we wished them well, with the hope that they may someday have their own hatchlings emerging from this same shore. #Philippines #LaUnion #Turtles",
