        "message": "Photo by jasperdoest / A female pigeon we named Dollie flies to the balcony door, where I installed a camera. She lands on the camera lens and uses the higher vantage point to check if the coast is clear before entering the kitchen. While my family and I have gotten to know our daily visitors as intelligent and social birds, pigeons must be one of the most unloved birds around. It’s fascinating to me that while many of the animals we don’t interact with are our most loved, the animals we draw into our lives unintentionally are often the most hated. Follow jasperdoest for more images of the human-wildlife connection. #pandemicpigeons #urbanwildlife #pigeon #citybirds",
