        "original_url": "https://www.instagram.com/p/CN0aBZIJ57K/",
        "message": "Photo by MartinEdstrom / It's a privilege to be able to walk down the beaten mud paths of Aït Benhaddou, one of many UNESCO World Heritage sites in Morocco. Walking the same dirt roads that have existed for centuries in this desert oasis is like traveling through time. Used in many movies and recognizable in many defining moments of Hollywood history, this old ksar (which roughly translates to \"fort\" or \"fortified village\") is a gem you definitely want to visit on your travels in northern Africa.\n\nToday is World Heritage Day, which celebrates sites such as this around the world. A lot of my work for natgeo has been centered on documenting places like this, often when they are somehow under siege from politics, climate, or other potential human threats to their existence. By supporting organizations like UNESCO, local museums, and cultural institutions, we can preserve these sites for generations to come. Let's not take them for granted. #morocco #worldheritageday #worldheritage #unesco",
