        "message": "Photo by Justin.Jin / A passenger boat travels along the oxbow in Tian-e-Zhou, a reserve for breeding the endangered river porpoise in the connected Yangtze River. Porpoises brought to the reserve in 1990 are now thriving. The original population of five animals has grown to nearly 80, close to the oxbow’s capacity of 100.\n\nIn 1991 China counted around 2,500 finless porpoises in the country's greatest river. Around 1,000 remain, a population smaller than that of the giant panda, according to the World Wildlife Fund (world_wildlife). This porpoise is now so critically endangered that, unless there is direct intervention, the Yangtze’s last surviving aquatic mammal will disappear forever, says WWF.\n\nFollow justin.jin for more stories and images from around the world. #china #yangtze #porpoise #justinjin",
