        "message": "Photo by laurakmorton / The fishing vessel “Amigo” returns to San Francisco’s Fisherman’s Wharf neighborhood to unload Dungeness crabs at the start of the commercial season in January. While the neighborhood is consistently ranked the city’s number one visitor destination, behind the tourist-focused businesses an essential fishing industry still operates there. Millions of pounds of seafood come through the wharf annually. Supported by InsideNatGeo’s Emergency Fund for Journalists, I have been working on a project on the Fisherman’s Wharf neighborhood, documenting the economic issues created by the COVID-19 pandemic, which are affecting communities relying on tourism around the globe. For more from this story and photographs of people, places, and culture, follow along laurakmorton.",
