        "original_url": "https://www.instagram.com/p/CNxJXFeMQXN/",
        "message": "Photo 📸 by stevewinterphoto \n\nA number of recent court cases in the USA are challenging the practice of breeding, exhibiting and selling big cats in the country, a practice that is so widespread that there are now more tigers across the USA than there are left in the wild. These court cases are challenging the legality of pulling newborn cubs from their moms, allowing tourists to cuddle them, bottle feed and pose for selfies with them. We need prosecutors in the USA to challenge and set a standard for dealing with this kind of animal cruelty. Remember that if you are ever offered a chance to play with a big cat at a captive facility say no! Say no to selfies, cuddles and bottle feeding too! By doing this we can collectively put pressure on facilities like the one in this photo where these white tiger cubs were caged. Read my photo story in my link in bio written by sharon.guynup 🦁\n.\n.\n.\n.\n.\n#tiger #tigerking #animalabuse #cruelty #caged #tigers #captivity",
