        "original_url": "https://www.instagram.com/p/CNw4b97gUT4/",
        "message": "Photo by tamaramerino_photography / Eric, a German immigrant, cooks a meal in his underground kitchen. He has lived in a cave since 1998. Though Spain's Sacromonte caves are known for their large Romany community, residents of the caves come from around the globe. In southern Spain, the rocky formations first served as a sanctuary from wild storms and predatory animals. Later, they offered protection from religious and racial persecution. Now, the structures are home to unique and quietly proud communities who have eschewed modern life for the peaceful solitude of the mountains. People have been living in these caves for more than 500 years, and today it is the largest cave settlement in Europe. This photo is part of my series Underland, which documents communities living underground or in caves around the world. And each of the communities I’ve documented—from Australia and Spain to the United States—have their own sociocultural, environmental, economic, or religious reason for living underground.\n\nFollow me on tamaramerino_photography for more photos from Underland. #caves #undergroundhouse #underland",
