        "message": "Photo by amivitale / This is Naomi Leshongoro getting a kiss from one of the baby orphaned elephants in her care at Reteti Elephant Sanctuary (r.e.s.c.u.e) in northern Kenya. Naomi is one of the first indigenous Samburu women elephant keepers in all of Africa. Empowering women is crucial to counteract the increasing pressure placed on this fragile landscape. Reteti is opening a door to a world of possibilities where women are equally entitled to working on their own land and protecting their wildlife. Reteti is changing the way these communities relate to wildlife, and this brings a sense of pride and responsibility to the women working at the sanctuary. They know that by caring for the elephants, their efforts are reducing poaching and human-wildlife conflict. Follow amivitale and r.e.s.c.u.e to learn more. conservationorg kenyawildlifeservice tusk_org sandiegozoo thephotosociety photography.for.good #elephants #kenya #conservation #empathyiseverything",
