        "message": "Photos by Michael Yamashita yamashitaphoto / The Grand Princess enters the city of Venice, dwarfing the 15th-century buildings edging St. Mark's Square. A blast of her horn sends pigeons scattering into the sky, completing my picture. Before COVID-19, 1.2 million cruise ship passengers were expected to disembark in Venice in 2020. But once the pandemic hit, the citywide lockdown left Venice's famed plazas, bridges, and canals empty. Venetians initially welcomed the return of their city to its citizens, but also feared the negative economic impact of lost tourism revenues. But many say the risk to this iconic city’s citizens and its fragile ecosystem churned up by these giants is too high a price to pay. When the city reopens, vessels like the Grand Princess (once the largest in the world) will no longer be allowed to approach St. Mark's Square or ply any of the waterways of central Venice. They will be rerouted outside the lagoon to the industrial port of Marghera, across from Venice. It seems that the days of mega-ships dominating canals and waterways may be history. This month marks the 1600th birthday of Venice. #Venice #cruiseship #PiazzaSanMarco #StMarksSquare",
