        "original_url": "https://www.instagram.com/p/CNuvRvBJIu8/",
        "message": "Photos by babaktafreshi / On this August 2015 night I was walking next to the black lava rocks on the rim of Haleakala Crater, 10,000 feet (3,048 meters) high on the top of Maui, Hawaii. I was alone on the mountain and it was very quiet. But the morning, when hundreds of visitors arrive to the summit for a spectacular sunrise, was approaching. In the ocean of stars above me, Orion was rising over the clouds around the crater's rim. Swipe to see a closer look. Note the three stars of Orion's Belt and the pale pink glow of the Orion Nebula. Most of this national park, including the volcano’s summit, is dark enough to experience pristine night sky, which is not visible to most of humanity due to light pollution.\n\nLearn more about dark sky places and why preserving them matters babaktafreshi. #haleakala #hawaii #stargazing #twanight",
