        "original_url": "https://www.instagram.com/p/CNuvMhuDg0u/",
        "message": "Photos by TimLaman / The blue bird of paradise, arguably one of the most fabulous of the entire bird of paradise family, has an extraordinary upside-down display that you can see in the second image. Found only in the highlands of Papua New Guinea, it is sadly one of the few bird of paradise species that is considered threatened, mainly due to habitat loss. My hope is that the blue and other bird of paradise species across the New Guinea region can be ambassadors for the protection of their rainforest. \n\nThroughout April for Earth Day, I’m sharing endangered species whose stories I’ve told with my images in hopes of bringing them more attention. Please visit TimLaman to see more. #bluebirdofparadsie #birdofparadise #NewGuinea #PNG #EndangeredSpecies",
