        "original_url": "https://www.instagram.com/p/CNuUnatgBx3/",
        "message": "Photo by justin.jin / The sun sets at a wetland sanctuary near the lower tributaries of the Yangtze, China’s greatest river. From its source on the icy Tibetan Plateau to its glittering delta on the East China Sea near Shanghai, the Yangtze River connects China’s disparate landscapes and cultures and propels economic growth. This has also made the world’s third longest river one of its most overworked and polluted, say experts from the World Wildlife Fund (world_wildlife). I journeyed with WWF to survey their projects connecting government, enterprises, and other stakeholders to protect the river. This year China imposed a 10-year commercial fishing ban on the Yangtze and its tributaries, including the adjoining lakes, to protect aquatic life.\n\nFollow justin.jin for more stories and images from around the world. #china #yangtze #river #justinjin #crane",
