        "message": "Photo jasonedwardsng - A large male lion focusing on nearby antelope grazing in a hilltop clearing. He had positioned himself beneath low acacias, disappearing into the deep shadows cast by the high sun. \n\nInsects were humming and the air was still and hot. Eventually the lion decided not to hunt but remained in the shade, an ideal location to observe the movements of prey in the clearing and below him on the dusty plain.\n\nPlease join me jasonedwardsng for images and stories from my National Geographic assignments. \n\n#natgeowild #jasonedwardsng #cateyes #tarangiri #tanzania",
