        "message": "Photo by daisygilardini / Grizzly bears are usually spread far apart from one another, owing to the large territory they need to roam for food. Because they’re usually spread so wide, they rarely cross each other’s path.\rWhen that happens, though, most encounters are unfriendly. Bears are always trying to establish their dominance, to assert their rights to food and territory. Body language, posture, bluff charges and loud noises determine the hierarchy. Younger bears will usually back down from their  much bigger elders and run away. They will do whatever they can to avoid actual fights because they know that can have serious consequences, including a bad injury or even death.\rIf food is abundant, though — during the annual salmon run, for example — they socialize more easily, and may even play-flight between feeding sessions.\nFollow me daisygilardini for more images and behind-the-scenes stories\n\r#grizzlybear #conservation #Alaska #play",
