        "message": "Photo by Matthieu Paley paleyphoto / Worldwide, air pollution kills millions every year, like a pandemic in slow motion. Here, coal smoke puffs from the chimneys of houses and gers in the early morning in Ulaanbaatar. The capital of Mongolia has grown rapidly and in an unplanned way in recent years, as nomadic herders have left the countryside and settled on the city's outskirts. Experts say insulating gers and providing better power connections would reduce home coal-burning and improve air quality. This is an unpublished image, part of a global story titled “The Deadly cost of Dirty Air” that appears in the April edition of National Geographic magazine. For more insights into our world, follow paleyphoto #airpollution #mongoliairpollution #coal #Ulaanbaatar\n\nCheck out Nat Geo's link in bio for more on this story.",
