        "original_url": "https://www.instagram.com/p/CNn4SERBtJk/",
        "message": "Photo by daisygilardini / Early morning alpenglow on the mountains of Scoresby Sound in Greenland. A Tyrolean legend from the Alps region that borders northern Italy and western Austria attributes the pink glow of mountain peaks just after the sunset and just before sunrise to an act of vengeance by the mythical King Laurin. Legend holds that King Laurin, excluded from the royal wedding of Princess Similde of Alpine lore, cursed a beautiful mountain rose garden: “Neither by day nor by night should anyone again glimpse this lovely sight.” This is why the pink glow of the rose garden can only be seen during twilight. Scientifically speaking, the Alpine glow is actually an atmospheric optical effect that occurs when red light waves reflect off the mountains.\n\nFollow me daisygilardini for more images and behind-the-scenes stories. #greenland #scoresbysund #iceberg #alpenglow #conservation",
