        "original_url": "https://www.instagram.com/p/CNmmNlmM6Tl/",
        "message": "Photo by CarltonWard / Biologists from the Florida Fish and Wildlife Conservation Commission (FWC) track radio-collared panthers from an airplane flying above the core panther territory in southwest Florida. Work by FWC and partners has helped bring the panther back from the brink of extinction, from as few as 20 in the 1970s to nearly 200 today. Conserving more land in the Florida Wildlife Corridor is now needed to help the panther reach sustainable numbers statewide.\n\nSee more in the April issue of National Geographic magazine and carltonward. To get this photo, I flew in another plane with a donated conservation flight by LightHawk_org.\n\nPathofthePanther is supported by the National Geographic Society, working to inspire the protection of the Florida Wildlife Corridor—the statewide network of public preserves combined with private farms, ranches, and forests that the panther needs to survive. insideNatGeo #FloridaWildlifeCorridor #KeepFLWild MyFWC",
