        "original_url": "https://www.instagram.com/p/CNmK1a9MnbD/",
        "message": "Photo of filipe_deandrade filming a Tiger Shark in the Bahamas. Sharks get a bad wrap for the misconception that they are mindless man eaters. As a species they have outlived the Dinosaurs and patrolled the ocean for over 400 million years. For almost that entire time, we haven't been around to witness their evolution therefore not been on their menu. In fact, Sharks are only involved in around 5 human mortalities per year while we kill over 100 million Sharks annually for Shark fin soup alone. Coexistence is not only possible but necessary. As apex predators they remove the dying, the dead and the dumb...basically serving as nature's vacuum cleaners. In order to preserve Sharks and protect the ocean, it is time we learn about them and discover the truth around them and the critical ecological purpose they serve. Photo by brianmoghari aboard the jim_abernethy Shearwater vessel follow filipe_deandrade for more wildlife adventures.",
