        "message": "Photo jasonedwardsng - Weighing Snow Leopards. I have spent decades working with carnivores both in captive breeding programs and in the wild. Depending on the species, we utilise a variety of methods to obtain an accurate weight. \n\nAfter the vet administered an anaesthetic, I would zero the scales and get a combined weight for myself and the cat. Then I would weigh myself and subtract that figure from the total. I liked my numbers more back then!\n\nMany years, hairstyles and miles later, the memory of how soft and dense Snow Leopard fur is still remains with me. \n\nPlease join me jasonedwardsng for images, prints and stories from my National Geographic assignments. \n\n#natgeowild #flashback #snowleopard #conservation",
