        "message": "Photos by carltonward / My obsession with setting camera traps for panthers began in 2015 in the Fakahatchee Strand. During the first year, dry season trails gave me two months before they filled with water and drowned my camera. The effort yielded one bear, one panther walking away from the camera, one alligator, and a number of lessons about pursuing photos of panthers in the Florida swamps. First was patience. After my initial attempt, the forest stayed flooded for the next 18 months. When the water receded in early 2017, I set a camera on a nearby swamp trail, pictured here, where our pathofthepanther team kept it going off and on for nearly four years. The ever-changing swamp challenged me and drew me into a hidden world that, through six years of struggle, I have fallen in love with. During the final month of the project, this site produced the panther photo I had in my mind's eye from the beginning. I will share that image here in the coming weeks. In this post I'm sharing photos from another lesson: the diversity of species that rely on the same trails as the panthers, including American alligator (with a giant salamander in its mouth), bobcat, raccoon, Florida black bears, opossum, otter, marsh rabbit, egret, and alligator again. ​\n \nBe sure to check out \"Return of the Panther,\" by douglas_main in the April issue of NatGeo magazine. The PathofthePanther project is supported by the National Geographic Society, working to inspire the protection of the Florida Wildlife Corridor—the statewide network of public preserves and private farms, ranches and forests that the panther needs to survive. ​Thanks to the field team Malia Byrtus leyoho alexofthewild and volunteers who kept this camera going across over the years and USFWS for permitting the work. insideNatGeo #FloridaWildlifeCorridor #KeepFLWild\n\nCheck out Nat Geo's link in bio for more on this story.",
