        "message": "Photo by journeying_justin // One of the craziest things about bighorn sheep is their eyes. They have horizontal pupils and eyes located on the sides of their heads to give them a panoramic view of their environment. If a predator were to appear on the horizon, there is a good chance this bighorn will see it. The only thing preventing him from getting a wider field of view, are those massive horns on his head. \n\nFollow journeying_justin for more wildlife stories. #natgeowild #natgeo #yellowstone",
