        "message": "Photo by paulnicklen / When photographing wildlife, I rarely opt for slow shutter speeds, as I did with this story. But opening myself up to the unexpected by attempting moodier exposures, playing with light, and going against the traditional rules of composition almost always yields an interesting result. I remember feeling a ton of pressure to capture images during this assignment. Despite being out of time for the day, I opted to put my telephoto away and mount a shorter lens on my tripod so I could shoot two-second exposures that would blur the water and create a moody feeling. I took hundreds of images before one worked out— thankfully, it was a waiting game worth playing.\n\nFollow me paulnicklen to hear more behind the scenes stories of my favorite images. #bear #spiritbear #kermodebear #canada #waitinggame",
