        "message": "Photo by beverlyjoubert / For much of our lives, we have worked and advocated for the protection of elephants and what they represent: their enormous value to ecosystems, their time-honored place among the last of the planet’s megafauna, the invaluable lessons we continue to learn from their complex social worlds … and so much more. Throughout this time, we have seen warnings about the future survival of these magnificent animals grow louder and more urgent. The latest comes from the International Union for the Conservation of Nature (IUCN), which recently classified forest elephants as critically endangered and savanna elephants as endangered. We can no longer afford to ignore these warnings. Unless we act with speed, determination, and genuine conviction to stem poaching and protect habitat, future generations will not see these giants roaming across Africa’s plains.\n\n#elephants #endangered #everyelephantcounts #endpoaching",
