        "original_url": "https://www.instagram.com/p/CNjcTrusNWR/",
        "message": "Photo by amivitale // Rhino keeper Zacharia Mutai touches the horn of Najin, one of the last two northern white rhinos on the planet. Najin, with her daughter Fatu, is cared for by the dedicated team at OlPejeta Conservancy in northern Kenya. Fossil records suggest that rhinos have existed for 50 million years, and they’ve lived on this planet for millions of years—yet it’s possible they might not survive mankind.\n\nHowever, hope remains - An extraordinary team from Leibniz Institute for Zoo and Wildlife Research (leibnizizw) #Avantea, OlPejeta Conservancy, KenyaWildlifeService and SafariParkDvurKralove created five northern white rhino embryos and are continuing to create more.  The plan is to implant them in a southern white rhino surrogate in the near future. \n\nLearn more, including how to support this important endeavor by following amivitale and BioRescue_Project.\n\nbmbf.bund leibnizgemeinschaft MinistryOfTourismAndWildlifeKE natgeo thephotosociety #NorthernWhiteRhinos #dontletthemdisappear #kenya #rhinos #saverhinos #africa #empathyiseverything",
