        "message": "Photo by daisygilardini | Meet Pollie, a Mexican hairy porcupine. Pollie was found alone, abandoned on the forest floor only a few days after birth.\rThe toucanrescueranch centre’s veterinarians initially syringe-fed her goats milk and the electrolyte solution Pedialyte, and from there the veterinarians were excited to watch her become bigger and stronger, and grow her quills.\rShe is advancing very well and showing off natural skills such as hiding during daylight hours, climbing high into trees when exercising, and using her prehensile tail for balance.\rI had the privilege to photograph Pollie during one of her first tree-climbing exercises in the ranch’s wild enclosure. I was amazed to see how agile and smart she is. Pollie will be released once she reaches a certain weight and develops the strength to survive on her own.\nFollow me daisygilardini for more images and behind-the-scenes stories\r\r#porcupine #mexicanhairyporcupine #costarica #conservation #rehabilitation #costarica #costaricawildlife  toucanrescueranch",
