        "original_url": "https://www.instagram.com/p/CNhBOvbgoat/",
        "message": "Photo by Cristina Mittermeier Mitty / My eyes scanned the colorful reef as I drifted along the gentle currents of St. Lucia. I studied the shape and texture of the coral below and couldn’t shake the feeling that somehow it was also studying me. Just as I was about to dismiss the strange thought and move on, I caught the tiniest flicker of movement, and with that, the illusion was shattered. I found myself looking into the eyes of an octopus. It stared up at me and then gave a wave of one of its arms, as if pressing me to move on—nothing to see here! These clever shapeshifters are almost impossible to detect when they’re in hiding, or in this case, waiting for unsuspecting prey to wander past. I’ve been lucky enough to spot quite a few of them on my dives and I’ve always found them to be personable and full of curiosity.\n\nFollow me Mitty for more marine life encounters as I work to help protect and restore our ocean’s most critical marine habitats.",
