        "image": "https://content-cdn.teaser.stackla.com/1451/607fbd0ae223d5b0ea066beb/image",
        "original_url": "https://www.instagram.com/p/CNglMj2qEHv/",
        "message": "Photo by amivitale / This is Mary Lengees embracing Long’uro, an orphaned baby elephant. In April, Long’uro, 18 months old, was brought to Reteti Elephant Sanctuary (r.e.s.c.u.e) with severe injuries. He had fallen into a well, and a hyena had eaten a third of his trunk. The prognosis was poor. Mary spent many sleepless nights looking after Long’uro until he recovered. Today, thanks to her love and all the keepers of Reteti, little Long'oru is thriving.\n\nMary is one of the first Indigenous Samburu female elephant keepers in all of Africa. Traditionally in Kenya, women are married young and are meant to take care of their children and homes. Although women had never been keepers before, they are now recognized as being an integral part of the sanctuary. Today Reteti has a total of 7 female keepers. The community is excited to hear what these women have accomplished, and rush to them when they return home to learn news of each of the elephants in their care.\n\nFollow amivitale and r.e.s.c.u.e to learn more.\n\nconservationorg kenyawildlifeservice tusk_org sandiegozoo thephotosociety photography.for.good #elephants #kenya  #conservation #empathyiseverything",
