        "message": "Photo jasonedwardsng - Young male hippo develop their strength, stamina and fighting skills during mock battles. There is always the potential for these sparring sessions to become serious because after all, hippo are notoriously aggressive and territorial. \n\nMales will spend a lifetime competing for dominance and mating rights in devastating fights that are known to result in death. The hippos immune system is being studied given their ability to recover from injuries and wounds that would spell death for most other species. \n\nPlease join me jasonedwardsng for images and stories from my National Geographic assignments. \n\n#natgeowild #jasonedwardsng #hippo #tanzania",
