        "message": "Photo 📷 by alexbraczkowski \n\nA young leopard looks down from atop a marula tree in the dulinilodge Sabi-Sands South Africa. I took this image with the help of broganparsonsphoto using a jib crane to get as close to the leopards in this area as possible. This is arguably the worlds most relaxed leopard population enjoying some of the best protection (you can find about 11-13 leopards per 100 km2 of land in this part of South Africa). Follow me alexbraczkowski for more images of big cats around the world 🌍 \n.\n.\n.\n.\n.\n#leopard #sabisands #beauty #spots #rosettes #catlove #catphoto",
