        "image": "https://content-cdn.teaser.stackla.com/1451/607fbd0be223d5b0ea066bfb/image",
        "original_url": "https://www.instagram.com/p/CNfTI4xLCUQ/",
        "message": "Photo by stevewinterphoto / A male African leopard brushes up against a large bush in South Africa's Sabi Sands Game Reserve. African leopards have lost 67-75% of their historic range, and of the nine leopard sub-species found globally, it's doing best in terms of its remaining range. Big cats are undergoing an extraordinary assault on their habitat, and even adaptable species like the leopard are suffering under the weight of land-use change, poaching, and also poaching of their prey. Leopards have flown largely under the radar of conservation biologists, and few knew just how threatened they were until a big assessment by leopard biologists from places like Iran, Sri Lanka, and South Africa revealed the extent of their range loss (see the paper by Andrew Jacobson and colleagues in Peer J, 2016). The good news is that we can save big cats like leopards, and the conservation actions are pretty simple: 1) work with communities living in and around leopard habitat and make them benefit from leopard tourism; 2) stop leopards killing farmers livestock through building bomas (protective livestock enclosures); 3) boost leopard prey populations through snare removal and good fire management; and 4) education and awareness of the threats facing leopards. Leopards are the world's most widespread big cat, extending from as far west as Gabon across the Middle East and south into east Asia on the island of Java! They are also one of the most threatened big cats.",
